import '../styles/ContactForm.css';
import Container from 'react-bootstrap/Container';

const ContactForm = () => {
    return (
       <>
       <br/>
       <Container>
         <div className="contact-form-container"><form>
             <p><b>Name</b> (required)</p>
                <input required className="contact-input-bar" type="text" placeholder="Enter your name" />
                <br/>
                <p><b>Email</b> (required)</p>
                <input required className="contact-input-bar" type="text" placeholder="Enter your email" />
                <br/>
                <p><b>Your Message</b> (required)</p>
                <textArea required className="contact-input-bar" type="text" placeholder="Type your message" />
                <br/>
                <button className="contact-button">Send</button>
</form>         </div>
         </Container>
       </>
    );
}

export default ContactForm;
